R["oh__@seminolegirl1992"]="{['TS']=1634173233,['na']={[33]={['N']='Hikova Estate',['O']=18819,['C']=1.021000,['D']='Owned by an aasimar couple expecting triplets. Features relics from ancient elven ruins on display, a sauna, gazebo sitting area, and garden canopy. The greenhouse room is for a half-dryad child they took in. ',},[2]={['N']='Khajiiti Caravan',['O']=18820,['C']=1.007000,['D']='Interior of a spacious khajiiti caravan. Comfortable cushions seat four. Plenty of room for storage and two bedrolls.',},[19]={['N']='Mythal War Room',['O']=18819,['C']=1.007000,['D']='A war room beneath the throne room of the sun elven kingdom of Elmaseranine, located in the High Forest. Ruled by a kind paladin, Levayne Galonodel. The transmute station represents an ancient, powerful scrying device. ',},[36]={['N']='Mecoud Palace',['O']=18890,['C']=1.021000,['D']='A quiet and romantic beach estate owned by a breton mage couple and their young son. Features an indoor garden, teleportation circle, hot tub, private getaway, tower, garden venue, and rooftop entertainment area.',},[87]={['N']='Kaladas Suite',['O']=18821,['C']=1.007000,['D']='Visiting Leyawiin? Enjoy a cozy suite in Kaladas Inn! Two beds, large wardrobe, and sitting area. Complimentary wine and chocolates provided.',},[68]={['N']='Crescent Inn',['O']=18821,['C']=1.007000,['D']='Located in the heart of Rimmen, come enjoy this private suite across the Sugar Bowl Inn! Features a queen sized bed, hot bath, sitting area, wardrobe, and nightstands. Complimentary wine provided. ',},[59]={['N']='Summerhome',['O']=18821,['C']=1.021000,['D']='This gorgeous 3-story Alinor home features 3 bedrooms (master has its own study), a large bathroom, aquarium, lounge, cozy kitchen/dining room, and a garden courtyard perfect for entertaining guests. A stairway leads to an upper garden, where you can relax on the hammock enjoying a good book and a beautiful view. ',},[17]={['N']='Rynne\\'s Home',['O']=18819,['C']=1.021000,['D']='A home belonging to a copper half-dragon follower of Bahamut and Corellon. Rynne works as a spy for the elven kingdom Elmaseranine, hence the portal, bounty sheets, and books on various cultures. She planted a beautiful garden in her courtyard and enjoys a quiet lifestyle in the small town of Daggerford. ',},[18]={['N']='Mystical Marvels',['O']=18819,['C']=1.041000,['D']='A magic items shop owned by a breton couple, filled with alchemical items, enchantment components, various magical artifacts, books, and more. Features weapons and armor crafted by her husband. Outdoor garden and waterfall.',},[62]={['N']='Crescent Grove',['O']=18914,['C']=1.020000,['D']='Located in the center of Arvandor, this palace is the home of the elven god and leader of the Seldarine, Corellon Larethian. It is a magical place where celestials and souls of fallen elves frolick and enjoy the afterlife. ',},[79]={['N']='House Baenre',['O']=18819,['C']=1.043000,['D']='Belonging to House Baenre, this compound of powerful noble drow is situated in Menzoberranzan, a city in the Underdark. Features an intimidating temple to the cruel spider queen Lolth, the malicious cleric Sos\\'Umptu\\'s bedroom, and her son Nym Baenre\\'s bedroom. Nym, imprisoned and tortured by his own family for abandoning Lolth and their ways, eventually escapes to the surface to begin a new life, following the good and humble creator of the elves, Corellon Larethian, Lolth\\'s most hated enemy. ',},},['Version']=1762,['Key']='oh__@seminolegirl1992',}"
